window.bookSummaryJSON = "<p>In <i>The Entrepreneur Roller Coaster</i> you will learn the best strategies Darren has ever collected from the most successful people on the planet, covering the four essential skills necessary for entrepreneurial success: sales, recruiting, leadership, and productivity.</p> <p>This essential guidebook will prepare you for the wild ride of entrepreneurship. It will warn you (of forthcoming fears, doubts, and the self-defeating conditioning of your upbringing and past), inoculate you (from the naysayers, dream-stealers, and pains of rejection and failure), and guide you (as you build those underdeveloped skills of independence, self-motivation, and self-accountability) safely past the landmines that blow up and cause the failure of 66 percent of all new businesses.</p> <p>Discover why NOW is the best time to #JOINTHERIDE.</p>"; 
